CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_CompareImport` ()  NO SQL
BEGIN
   DECLARE id_actuel INT;
   DECLARE id_precedent INT;

   SELECT MAX(id_import) From Import INTO id_actuel;
   SELECT MAX(id_import) - 1 From Import INTO id_precedent;

                          transmission, FollowStatus, id_import)
   Select nouveaux.email, nouveaux.firstname, nouveaux.lastname, nouveaux.language, nouveaux.country, nouveaux.type,
          nouveaux.nickname, nouveaux.town, nouveaux.state, nouveaux.level, 
          nouveaux.gender, nouveaux.transmission, nouveaux.FollowStatus, id_actuel as id_import
   From
   (
     Select actuel.email, actuel.firstname, actuel.lastname, actuel.language, actuel.country, actuel.type, 
            actuel.nickname, actuel.town, actuel.state, actuel.level, actuel.gender, 
            actuel.transmission, actuel.FollowStatus
     From 
         Import_email actuel
         Left Join Import_email precedent
         on precedent.email = actuel.email And precedent.id_import = id_precedent
   
     Where actuel.id_import = id_actuel
       and precedent.email is null
    ) as nouveaux;

   Delete MC_Member
   From MC_Member
   INNER JOIN 
   (
     Select precedent.email
     From 
         Import_email precedent
         Left Join Import_email actuel
         on actuel.email = precedent.email And actuel.id_import = id_actuel
   
     Where precedent.id_import = id_precedent
       and actuel.email is null
    ) as supp on supp.email = MC_Member.email;

    Update MC_Member MC 
    Join Import_email i
    On MC.email = i.email
    And i.id_import = id_actuel
    Set MC.firstname = i.firstname, MC.lastname = i.lastname, MC.language = i.language, MC.country = i.country, 
        MC.type = i.type, MC.nickname = i.nickname, MC.town = i.town, MC.state = i.state, MC.level = i.level, 
        MC.gender = i.gender, MC.transmission = i.transmission, 
        MC.FollowStatus = i.FollowStatus;

    Delete From MC_Member_list;
	
    Select email, list
    From Import_email_list l
    Where l.list <> 'International Mailouts'
      and l.id_import = id_actuel;

    Delete From Import_email_list Where id_import < id_precedent;
    Delete From Import_email Where id_import < id_precedent;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_GenerateAll` ()  NO SQL
