CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_SelectRaisonUnsubscribed` ()  NO SQL
BEGIN 

    DECLARE id_actuel INT;

    SELECT MAX(id_import) From Import INTO id_actuel;

    SELECT ie.email, ie.firstname, ie.lastname, ie.FollowStatus, iel.list
    FROM `import_email` ie
    left join `import_email_list` iel
    on iel.email = ie.email
    and iel.id_import = ie.id_import
    WHERE ie.id_import = id_actuel - 1
    and ie.email not in (Select x.email From `unsubscribers_return_to_elohim_net` x Where x.email = ie.email)
    and ie.email in
    (
    'michael.mougin@gmail.com',
    'modje.gilbert@gmail.com'
    );

END$$

