CREATE DEFINER=`root`@`localhost` FUNCTION `FN_InternationalMailoutsOnly` (`email_in` VARCHAR(1024) CHARSET latin1) RETURNS VARCHAR(1024) CHARSET latin1 NO SQL
BEGIN
  DECLARE email_found VARCHAR(1024);
  
  Select z.email INTO email_found
  From
    (
     Select email, count(*) as cpt
     From MC_Member_list
     Where list = 'International Mailouts'
       and email = email_in
     Group by email
     Having count(*) = 1
  ) as z
  Where z.email = email_in;

  RETURN email_found;
END$$

