DELIMITER $$
CREATE TRIGGER `OnDeleteMC_Member` BEFORE DELETE ON `mc_member` FOR EACH ROW BEGIN
  DECLARE id INT;

  SELECT MAX(id_import) FROM Import INTO id;

  IF old.FollowStatus Not in ('Email bounced','Not interested') AND 
     old.type in ('S','R','P','X','XS') THEN
       VALUES (id, old.email, old.firstname, old.lastname, SYSDATE(), old.FollowStatus);
  END IF;

  
  Delete From MC_Member_list Where email = old.email;  

END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `OnUpdateMC_Member` AFTER UPDATE ON `mc_member` FOR EACH ROW BEGIN
  DECLARE id INT;

  SELECT MAX(id_import) FROM Import INTO id;

  IF NEW.FollowStatus in ('Email bounced','Not interested') AND 
     OLD.FollowStatus Not in ('Email bounced','Not interested') AND 
     NEW.type in ('S','R','P','X','XS') THEN
       VALUES (id, NEW.email, NEW.firstname, NEW.lastname, SYSDATE(), NEW.FollowStatus);
  END IF;

END
$$
DELIMITER ;

